    .set('X-Query-Key', 'NRIQ-j7zJFckfarn9jsOB-nPscK5H6z0QCgHd')
    .set('Accept', 'application/json')
    .end((err, res) => {
      // Calling the end function will send the request
      console.log('res: ', res)
    });

  return res.json({ hello: 'world!' });
};
